jenkins:

  numExecutors: 1

  log:
    recorders:
      - name: "dev"
        loggers:
          - name: "hudson"
            level: "INFO"
          - name: "jenkins"
            level: "INFO"

  disabledAdministrativeMonitors:
    - "jenkins.diagnostics.SecurityIsOffMonitor"
    - "jenkins.diagnostics.ControllerExecutorsAgents"
    - "jenkins.diagnostics.ControllerExecutorsNoAgents"
    - "jenkins.diagnostics.RootUrlNotSetMonitor"

  authorizationStrategy: unsecured

unclassified:
  globalUntrustedLibraries:
    libraries:
      - defaultVersion: main
        implicit: true
        name: large-library
        includeInChangesets: false
        retriever:
          modernSCM:
            scm:
              gitSource:
                remote: https://github.com/jonesbusy/jenkins-reproduce.git

security:
  apiToken:
    creationOfLegacyTokenEnabled: false
    tokenGenerationOnCreationEnabled: false
    usageStatisticsEnabled: false

jobs:
  - script: >
      pipelineJob('large-job-to-replay') {
        displayName('large-job-to-replay')
        description('large-job-to-replay')
        definition {
          cps {
            sandbox(true)
            script("""
              pipeline {
                agent {
                    label('built-in')
                }
                stages {
                  stage('Large Step') {
                    steps {
                      aStep1()
                      aStep2()
                      aStep3()
                      aStep4()
                      aStep5()
                      aStep6()
                      aStep7()
                      aStep8()
                      aStep9()
                      aStep10()
                      aStep11()
                      aStep12()
                      aStep13()
                      aStep14()
                      aStep15()
                      aStep16()
                      aStep17()
                      aStep18()
                      aStep19()
                      aStep20()
                      aStep21()
                      echo ''
                      echo ''
                      echo ''
                      echo ''
                    }
                  }
                }
              }
            """)
          }
        }
      }
